(2, '1620217248_42197', '2021-05-05', '12:20:48', 'show', 'How To List Your Event On Attendout And Register Participants', '<p>You can list your event - manage your event - and sell tickets to your events on Attendout.&nbsp;</p><p>Follow these steps to list your event and register participants on Attendout:</p><ul><li>On Attendout, click on <strong>â€œcreateâ€</strong> and select <strong>â€œevent.â€</strong></li><li>Fill in the event name (e.g. <strong>â€œThe Beauty of Musicâ€</strong>) and select the event category.</li><li>If it is an online event, specify the platform where the event will be hosted and add details that will be needed to access the event.</li><li>Specify the event date and time and describe the event as simply as you can.</li><li>Add a unique name to the event URL, e.g., <strong>â€œTBMâ€</strong> &nbsp;- and add organizers\' details</li><li>Add an image to the event - tick the registration and ticket selling box if you would like to take registrations and sell tickets on Attendout.</li><li>Post the event</li></ul><p>If you choose not to take registrations on Attendout, the event has been posted and you can make it visible to the public by publishing it.</p><p>If you want to take registration on Attendout, you would have ticked the registration box. And if you did not tick the box, you can click on â€œregistration settingsâ€ and continue with these steps:</p><ul><li>Select free or paid event</li><li>If it is a free event - select if you want to set registration and enable QR access, then post.</li><li>For a paid event, select currency type and select if you want to sell tickets on Attendout</li><li>If you want to sell tickets on Attendout, select if it is a single or categorized ticket.</li><li>If it is a categorized ticket, click <strong>â€œadd planâ€</strong> and fill in the plan name - the plan price - the number of admission - and the number of tickets available.</li><li>If it is a single ticket, fill in the price - set the deadline for selling of tickets - select if you want the registration to be public or you want to register people yourself</li><li>Select the maximum number of registration - tick the box if you want to enable QR access</li><li>Post the event</li></ul><p>You can set customized registration questions for the event. If the event will not hold online, you can set the location for your event. Participants will be able to reach your event by following the direction.&nbsp;</p><p>&nbsp;</p>', 'https://attendout.com/uploads/162837623457780filename.jpg', NULL, '1'),
(4, '1620219714_63167', '2021-05-05', '13:01:54', 'show', 'How To Add Participants And Manage Voting Result', '<p>Voting types can either be categorized or non-categorized. The difference between categorized and non-categorized is that you need to create categories before adding participants for \"categorized voting.\"&nbsp;</p><p>After posting your vote, you will be taken to the <strong>â€œmanage votingâ€</strong> page On the page, follow these steps:</p><ul><li>Click on <strong>â€œcategory settingsâ€</strong> and add all the categories you want. Click on <strong>â€œadd categoryâ€</strong> to add a category.</li><li>On the <strong>â€œcategory settings\"</strong> page, click on <strong>â€œadd contestantsâ€</strong> to add participants.</li><li>On the <strong>â€œadd contestantsâ€ </strong>page, fill in the participant\'s name - select the category that the participant fits in among the categories you created - describe the participant - and add the participant\'s image. &nbsp;Then click on <strong>â€œadd contestant.â€</strong></li><li>When you are finished with creating categories and adding all participants to suitable categories, click on â€œmanage votingâ€ to go back.</li><li>On the <strong>â€œmanage votingâ€</strong> page, &nbsp;you can click on <strong>â€œopen votingâ€</strong> to open the voting polls.&nbsp;</li></ul><p>After opening the vote on the â€œmanage votingâ€ page, you can go to the â€œresult pageâ€ to monitor your voting and control the process. To get to the â€œresult page,â€ click on â€œpublic pageâ€ and click on the â€œresult menu.â€</p><p>On the \"<strong>result page,\"</strong> you can pause voting to temporarily close the voting polls. You can close voting to process voting results and permanently close the voting polls. You can edit your result settings to change your result visibility and how transparent you want your result to be.&nbsp;</p><p>&nbsp;</p>', 'https://attendout.com/uploads/162837889991953filename.jpg', NULL, '3'),
(5, '1620220959_81999', '2021-05-05', '13:22:39', 'show', 'How To Create Online Voting On Attendout', '<p>Online voting on Attendout is secure, seamless, and transparent. On Attendout, you can control how Open and transparent you want your voting process and results to be.</p><p>To vote on Attendout, follow these steps:</p><ul><li>Click on <strong>â€œCreateâ€</strong> and select <strong>â€œonline votingâ€</strong></li><li>Fill in the title of the voting. E.g. â€œMost Extroverted.â€</li><li>Fill in a voting unique name. E.g. â€œME.â€ A voting unique name distinguishes your voting URL.</li><li>Select a Voting Mode. The voting mode depicts how open or restricted your voting process will be. There are three types of voting modes and each mode has a different effect on your voting process. The modes are:</li></ul><p><strong>Basic:</strong> If you select â€œBasic,â€ voters will not be required to register or log in to vote.</p><p><strong>Strict:</strong> If you select â€œStrict,â€ voters will be required to vote by creating accounts and voting. One-click Sign Up is available on the voting page. Selecting â€œStrictâ€ is suitable when you want to eliminate the probability of multiple voting by a voter.&nbsp;</p><p><strong>Paid:</strong> If you select â€œPaid,â€ voters will be required to pay to vote for their favourite contestants. A processing fee of 5 percent applies.</p><ul><li>You can enable or disable <strong>â€œdaily voting.â€</strong> If it is enabled, voters can vote once daily. But voters can only vote once if it is disabled. Daily voting only applies to Basic and Strict voting mode. Voters can vote as much as possible on paid voting</li><li>Select result visibility. Result visibility depicts how transparent your voting process will be. If you select <strong>â€œpublic,â€</strong> the result is visible to voters on the voting page as voting continues. If you select <strong>â€œprivate,â€ </strong>the result is not shown on the voting page - however, you can decide if you want to make it accessible to voters after the voting process.</li><li>Select voting type. <strong>â€œCategoriesâ€</strong> and <strong>â€œNo Categoriesâ€</strong> are the two voting types. With categorized voting, contestants are put in different categories and results are calculated based on categories while non-categorized shows a single category and calculates results based on that.</li><li>Select if you want to add participants\' description and show participants\' images.</li><li>Describe the voting, ie. what the voting is about.</li><li>Add your contact details and social media platforms if you want to. Add a banner image of your voting for uniqueness.</li><li>Post your voting.</li></ul><p>To learn how to add participants to your voting on Attendout, click <a href=\"https://attendout.com/docs?id=1620219714_63167\">HERE</a></p>', 'https://attendout.com/uploads/162837651521019filename.jpg', NULL, '2'),
(6, '1620221280_21474', '2021-05-05', '13:28:00', 'show', 'How To Manage Your Wallet On Attendout And Make Withdrawals', '<p>To access your Wallet on Attendout, go to <strong>â€œmanageâ€</strong> and click on <strong>â€œwithdraw revenue.â€</strong> You are taken to your wallet page.&nbsp;</p><p>On your wallet page, you need to create a four-digit wallet pin that will be required anytime you attempt to make a withdrawal. Without creating a pin, you can not make any withdrawal.&nbsp;</p><p>On your wallet page, there is a &nbsp;process your revenues pass through.</p><p><strong>â€œTotal revenueâ€</strong> shows the total amount of money made through event registration or voting.&nbsp;</p><p><strong>â€œAvailabe in wallet\"</strong> shows the total amount of money yet to be withdrawn from the total revenue made.&nbsp;</p><p><strong>â€œAvailabe for withdrawalâ€ </strong>shows the total amount of money that has been cleared for withdrawal. Since revenues do not get cleared for withdrawal until after 48 hours after they have been received, money available for withdrawal can be different from money available in your wallet.&nbsp;</p><p><strong>â€œPending withdrawalâ€</strong> shows the amount of money that has been withdrawn but is yet to be successful. An unsuccessful withdrawal sends your money &nbsp;back to <strong>â€œavailabe for withdrawalâ€</strong> while a successful withdrawal sends your money to <strong>â€œpaid out.â€</strong></p><p>You can also download the details of your donors in different formats and change events on the wallet page.&nbsp;</p><p><strong>Note:</strong> The minimum amount of money you can withdraw on Attendout is 150 Naira.</p><p>&nbsp;</p>', 'https://attendout.com/uploads/162837641969668filename.jpg', NULL, '4'),
(7, '1620221907_52626', '2021-05-05', '13:38:27', 'hide', 'Creating your brand on Attendout', '<p>To register your brand with attendout.com, click on â€œBrandsâ€ on the navigation bar which will take you to page with lists of all registered brands. Locate â€œCreate Your Brandâ€ button and click on it, this will take you to a form page where you can register your page.</p><ol><li>Fill in your brand name</li><li>Select the things your brand is into, E.g, Event management, catering etc.</li><li>Fill in your brandâ€™s current location.</li></ol><p>A unique name should not be strange to you as it has been explained to you earlier.</p><ol><li>Choose a unique name for your brandâ€™s url.</li><li>Write a detailed information about your brand.</li><li>The final step is to add your brandâ€™s logo, and you are good to go!</li></ol>', 'https://attendout.com/uploads/162022190870618filename.jpg', NULL, ''),
(8, '1630793662_59697', '2021-09-04', '22:14:22', 'show', 'How to Customize Tickets', '<p>To customize a ticket on Attendout, you need to have created an event. If you haven\'t created an event, click <a href=\"https://attendout.com/docs?id=1620217248_42197\">here</a>.</p><p><strong>How To Customize Tickets:</strong></p><ul><li>On the menu, go to â€œcreateâ€ and click on â€œtickets.â€</li><li>To customize your ticket on the \"ticket studio\" page, &nbsp;add the base image. Base image in this case is your already designed Graphics for tickets, with a space to accomodate the QR Box and name box.</li><li>After adding the base image, you can adjust the QR box size and drag it to any position on the ticket.</li><li>You can also adjust the name box and drag it to any position on the ticket.</li><li>The QR box shows the QR code while the name box shows the participant\'s name.</li></ul><p>If your ticket is a categorized ticket and you have different ticket categories, you will need to customize tickets for all categories.</p><p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;</p>', 'https://attendout.com/uploads/163089836290363filename.jpg', NULL, '5'),
(9, '1678109343_25320', '2023-03-06', '13:29:03', 'show', 'Make Spraying Money at Events Hassle-Free with Attendout\'s Innovative System', '<p>If you\'ve ever attended an event in Nigeria, you\'re probably familiar with the tradition of spraying money. While it\'s a fun and exciting way to celebrate, it can also be a hassle to carry around large sums of cash. But with Attendout\'s new system, spraying money has never been easier or more convenient.</p><h4>Here\'s how it works:</h4><p><strong>Create a Stage</strong>: As the event organizer, you can create a stage on Attendout\'s platform and add designations such as \"Bride,\" \"Groom,\" \"Live Band,\" \"Bride\'s Mother,\" and more.</p><p><strong>Add People to Your Stage</strong>: You can then add attendees to your stage and assign them to a specific designation. Each attendee must have an Attendout account, and you\'ll need to provide their username when adding them to the stage.</p><p>Share the Link and QR Code: Once you\'ve set up your stage, Attendout will provide you with a unique link and QR code that you can share with attendees. They can use this link to access their spending page and start spraying money.</p><p><strong>Spray Money in Currencies and Denominations</strong>: Attendees can choose from multiple currencies and denominations when spraying money. The system will credit the designated Attendout account with the amount sprayed.</p><p><strong>Visualize Spending on Screen</strong>: The stage page can be projected on a screen, and attendees can tap to spend money. The screen will show who is spending and the denomination they are using. This adds an exciting visual element to the party and allows attendees to see how much they\'ve sprayed.</p><p>But Attendout\'s system is not just limited to physical events. In today\'s world, virtual events are becoming increasingly popular, and Attendout\'s system can be used for those too. Whether you\'re attending a wedding, birthday party, or any other type of celebration, Attendout\'s system allows you to spray money hassle-free.</p><p>And if you\'re from a remote location and can\'t attend the event in person, you can still participate in the tradition of spraying money. Attendout\'s system allows you to spray money virtually, making it the perfect solution for anyone who can\'t attend the event in person.</p><p>In conclusion, Attendout\'s innovative system makes spraying money at events hassle-free, convenient, and secure. Whether you\'re attending a physical or virtual event, Attendout\'s system allows you to participate in the tradition of spraying money without the hassle of carrying around cash. So why not try Attendout\'s system at your next event?</p>', NULL, NULL, '1'),
(11, '1679166759_75963', '2023-03-18', '19:12:39', 'hide', 'How To Generate Your Creative Idea With IT Business', '<p>There are several advantages and benefits of organizing an event, both for individuals and organizations. Firstly, it offers a perfect chance to promote brand awareness by showcasing products and services. Whether it is a corporate or social event, it can attract potential customers, build brand recognition, and increase customer base. Secondly, events provide opportunities to expand one\'s network by meeting like-minded individuals, industry experts, and potential customers. Through attending and organizing events, one can build relationships that can lead to partnerships, collaborations, and new business opportunities. Thirdly, events can generate significant revenue through ticket sales, sponsorships, and vending opportunities. It is also possible to monetize events by providing premium services such as VIP seating and other value-added services. Fourthly, events help build a sense of community among attendees by creating a platform for people to interact, share ideas and experiences. Finally, events are a great opportunity to learn about new ideas, trends, and developments in a particular industry or field. By organizing and attending events, individuals and businesses can stay up-to-date with the latest industry trends and developments. In summary, organizing an event can be beneficial as it provides an opportunity for brand promotion, networking, revenue generation, community building, and exposure to new ideas.</p>', 'https://attendout.com/uploads/167916675993168filename.jpg', NULL, '1'),
(12, '1679241608_90066', '2023-03-19', '16:00:08', 'show', 'How To Generate Your Creative Idea With IT Business', '<p>Welcome to Attendout, a comprehensive event management system designed for event organizers, promoters, and attendees. Our platform provides a user-friendly experience for creating, managing, and promoting events of any size or type.&nbsp;<br><br>With Attendout, users can easily create an account and start creating events right away. Our platform makes it easy to manage ticket sales, track attendance, and even withdraw funds to their wallets. We believe that organizing events should be stress-free, and we\'ve built our app to make it simple for anyone to get started.<br><br>One of the unique features of Attendout is our voting system. Event organizers can set up voting polls and receive funds for voting. This feature is perfect for events such as talent shows or competitions where the audience can participate in the voting process while also supporting the event.<br><br>Attendout also makes it easy to find vendors for your event. Our platform provides a list of vendors that you can browse through and connect with to make your event a success. We believe that finding the right vendors should be easy, and our platform takes the hassle out of the process.<br><br>In summary, Attendout is the go-to platform for anyone looking to create and manage successful events. Our user-friendly platform, intuitive features, and comprehensive vendor list make it easy for anyone to create the perfect event. So why not sign up today and start organizing your next event with Attendout?</p>', 'https://attendout.com/uploads/167924160856564filename.jpg', NULL, '1');
INSERT INTO `panel_faq` (`id`, `input_question`, `text_answer`, `select_category`, `date_created`, `time_created`, `hash_id`, `visibility`, `input_order`) VALUES
(9, 'What is Attendout and what can it be used for?', '<p>Attendout is an event, training, and voting management platform.</p><p>With Attendout, you can:</p><ul><li>List events and training, have a personalized page for events and training, take registration for events and training, keep events and training data, and access events and training data individually and in bulk.</li><li>Categorize events and training into free and paid</li><li>Create custom registration questions, verify tickets and registrations, and set deadlines for registration</li><li>Create a voting page, add voting categories, create voting restriction level, &nbsp;add participants and manage your voting result effectively</li><li>Create DP for your events and campaigns irrespective of whether it was created on Attendout or not</li><li>List brands</li></ul><p>&nbsp;</p>', NULL, '2020-11-28', '03:50:04', '1606535404_60759', 'show', '1'),
(13, 'How can I  know my current account plan?', '<p>After signing in, click on â€œMy &nbsp;Account.â€ Your account plan is shown beside your profile name.&nbsp;</p><p>The account plans are:</p><ul><li>Free</li><li>Basic</li><li>Standard</li><li>Exclusive</li></ul><p>Visit <a href=\"https://attendout.com/sub\">https://attendout.com/sub</a> for details of the plans</p>', NULL, '2021-04-13', '13:53:19', '1618321999_26302', 'show', '4'),
(14, 'Who can leverage on Attendout Platform for business?', '<ul><li>Social Media Influencers</li><li>Event Planners and Managers</li><li>Digital Marketers</li><li>Event Vendors</li><li>Businesses</li><li>Trainers. etc.</li></ul><p>&nbsp;<br><br>&nbsp;</p><p>&nbsp;</p><p>&nbsp;</p><p>&nbsp;</p>', NULL, '2021-04-13', '13:54:05', '1618322045_84530', 'show', '2'),
(15, 'Must I pay to use Attendout?', '<p>Attendout is free to use. However, a 5 percent charge applies to paid events, training, and voting. Attendout has a premium plan which gives access to more cool features like receiving donation</p>', NULL, '2021-04-13', '14:00:24', '1618322424_73736', 'show', '3'),
(16, 'What if I don\'t want to use the QR code feature. Can I still list my event?', '<p>You can list your event on Attendout without using the QR feature. Also, there are other features on Attendout that you can choose not to use while listing your event. Only necessary features are required</p><p>&nbsp;</p><p>&nbsp;</p>', NULL, '2021-04-13', '14:01:17', '1618322477_58838', 'show', '15'),
(17, 'What if participants lost their QR code before event day?', '<p>For premium accounts, your participants will get an e-mail after registration with their QR code download link. The QR code can be retrieved from their mail anytime. For free accounts, you can verify their registrations through other means&nbsp;</p><p>&nbsp;</p>', NULL, '2021-04-13', '14:04:35', '1618322675_55386', 'show', '14'),
(18, 'How do participants get their QR.?', '<p>While listing an event on Attendout, you will be asked if you would like to use QR verification. If you choose to use QR, your intending participants will be presented with a QR code for download after registration. If you are a premium user, your participants will also get a notification mail with the QR</p>', NULL, '2021-04-13', '14:05:19', '1618322719_73557', 'show', '12'),
(19, 'What if I don\'t want my registration to be public and wants to register specific people?', '<p>While listing events on Attendout, you can select whether you want to register specific persons or you want to make it open to the public.<br>When you choose to register specific persons, your registration will not be visible to the public and only your account can register people for your event. You will get QR for every registration you make. If you are a premium user, your registered participants will get the QR and registration notification in their mail</p>', NULL, '2021-04-13', '14:06:10', '1618322770_67095', 'show', '7'),
(22, 'What if there is an issue during payment?', '<p>The payment system is 100 percent reliable. However, every Payment has an invoice generated. If you send us your invoice code, we will be able to resolve your payment issue</p>', NULL, '2021-04-13', '14:16:13', '1618323373_28498', 'show', '11'),
(23, 'I deal with skills like shoemaking, tailoring, hairdressing and the likes.  Can I also list my training on Attendout?', '<p>Yes, you can list any kind of lawful training on Attendout.</p>', NULL, '2021-04-13', '14:16:49', '1618323409_27783', 'show', '16'),
(24, 'How do I get my money when people register for events and training?', '<p>Attendout has a wallet system that can be accessed by clicking â€œmanageâ€ and then clicking â€œwithdraw revenue.â€ You will be required to secure your wallet with a 4 digit pin the first time you visit â€œwithdraw revenue.â€ This pin will be required every time you attempt to make withdrawals. You can make a withdrawal anytime but you will receive funds 48 hours after a withdrawal has been made.&nbsp;</p><p>&nbsp;</p>', NULL, '2021-04-13', '14:18:09', '1618323489_72412', 'show', '9'),
(25, 'Why 48 hours? Why can\'t I just receive the withdrawn funds immediately?', '<p>The 48 hours window is available to resolve any payment conflict that might have ensued during the registration process. It\'s a means to facilitate effortless withdrawal.&nbsp;</p><p>&nbsp;</p>', NULL, '2021-04-13', '14:19:43', '1618323583_41941', 'show', '10'),
(26, 'As a free user, how can I become a premium user?', '<p>Visit <a href=\"https://attendout.com/sub\">https://attendout.com/sub</a> and select a suitable plan. There is a monthly, quarterly, and yearly subscription for all kinds of premium&nbsp;</p>', NULL, '2021-08-01', '15:06:40', '1627830399_76313', 'show', '5'),
(27, 'How can I create an event on Attendout?', '<p>Creating an event on Attendout is an easy process and it has been well-documented&nbsp;</p>', NULL, '2021-08-02', '23:55:27', '1627948527_83989', 'show', '6'),
(28, 'Can I limit  the number of registrations that can be made?', '<p>Yes. While creating an event, there is a feature that asks you for the number of maximum registrations you want to allow.&nbsp;</p>', NULL, '2021-08-03', '01:45:38', '1627955138_55166', 'show', '8'),
(29, 'How can i create online voting on  Attendout?', '', NULL, '2021-08-03', '19:14:27', '1628018067_41902', 'hide', '17');
