(5, 'Owolabi Benita Ayodeji', 'Ayodele Brown Akande', 'doublejoy2021', '2021-10-01', 'WED_16331048707i1e1bol6d50aw7977ow', '04:14:30', 'hide', NULL, 'a:1:{s:28:\"RW5nYWdlbWVudCBQYXJ0eS9hbGw=\";a:5:{s:2:\"id\";s:28:\"RW5nYWdlbWVudCBQYXJ0eS9hbGw=\";s:8:\"schedule\";s:16:\"Engagement Party\";s:11:\"designation\";s:30:\"Friday, 8th October,2021.  1pm\";s:5:\"venue\";s:44:\"Adetiloye Hall, Iyin Road, Basiri, Ado-Ekiti\";s:8:\"guestdes\";s:640:\"<p><i><strong>EVENT FLOW</strong></i></p><p>ðŸ’žEngagement Commences 1PM<br>ðŸ’žEngagement Ends 3PM.</p><p>ðŸ’žMC Recognizes Guests &amp; Dignitaries 3PM - 3:30PM<br>ðŸ’žSax brings in Grooms Family First and then Bride\'s 3:30-4PM<br>ðŸ’žCouple\'s Grand Entrance<br>(DJ Plays) 4PM -4:30PM</p><p>ðŸ’žFlourish Daniel\'s Music (1 Song) 4:30-4:45PM<br>ðŸ’žGabriel Elson\'s Music Performance (2 Songs) 4:45-5PM</p><p>ðŸ’žErelu\'s Marital Counsel 5-5:15PM</p><p>ðŸ’žGorosoEkiti\'s Comedy(2 Materials) 5:15-5:30PM<br>ðŸ’žMerlimpy &amp; GMP Performs (2 songs &amp; 1 Comedy) 5:30-5:45PM</p><p>Gifts are brought forward and Party Begins till fade Out.</p>\";}}', NULL, '<p><a href=\"\"><i><strong>WEDDING TOAST</strong></i></a></p><p>I love you without knowing how, or when, or from where.<br>I love you directly without problems or pride.&nbsp;<br>I love you like this because I donâ€™t know any other way to love,<br>so close that your hand upon my chest is mine,<br>so close that your eyes close with my dreams.</p><p>-<strong>Ayodeji</strong></p><p>I fell in love with her courage, craziness, her sincerity, openness, and her flaming self respect.&nbsp;<br>And it\'s these things I\'d believe in, even if the whole world indulged in wild suspicions that she wasn\'t all she should be. I love her and it is the beginning of everything.</p><p>-<strong>Ayodele</strong></p><p>&nbsp;</p>', 'a:10:{i:49361633105776;a:2:{s:5:\"image\";s:40:\"uploads/163310577557089wedding_image.jpg\";s:5:\"thumb\";s:32:\"thumb/8234750thumb1633105776.jpg\";}i:94621633106061;a:2:{s:5:\"image\";s:40:\"uploads/163310606153123wedding_image.jpg\";s:5:\"thumb\";s:32:\"thumb/9063699thumb1633106061.jpg\";}i:56791633106645;a:2:{s:5:\"image\";s:40:\"uploads/163310664510588wedding_image.jpg\";s:5:\"thumb\";s:31:\"thumb/572830thumb1633106645.jpg\";}i:80181633108309;a:2:{s:5:\"image\";s:40:\"uploads/163310830951747wedding_image.jpg\";s:5:\"thumb\";s:32:\"thumb/9427359thumb1633108309.jpg\";}i:60611633108498;a:2:{s:5:\"image\";s:40:\"uploads/163310849865672wedding_image.jpg\";s:5:\"thumb\";s:32:\"thumb/3621726thumb1633108498.jpg\";}i:36151633127154;a:2:{s:5:\"image\";s:40:\"uploads/163312715429955wedding_image.jpg\";s:5:\"thumb\";s:32:\"thumb/5929203thumb1633127154.jpg\";}i:47141633127886;a:2:{s:5:\"image\";s:40:\"uploads/163312788678255wedding_image.jpg\";s:5:\"thumb\";s:32:\"thumb/2465330thumb1633127886.jpg\";}i:41491633127920;a:2:{s:5:\"image\";s:40:\"uploads/163312792016455wedding_image.jpg\";s:5:\"thumb\";s:32:\"thumb/4609128thumb1633127920.jpg\";}i:25321633127996;a:2:{s:5:\"image\";s:40:\"uploads/163312799636431wedding_image.jpg\";s:5:\"thumb\";s:32:\"thumb/5894653thumb1633127996.jpg\";}i:89271633128118;a:2:{s:5:\"image\";s:40:\"uploads/163312811766720wedding_image.jpg\";s:5:\"thumb\";s:32:\"thumb/2314037thumb1633128118.jpg\";}}', '1633097164ia53tre1363l4n9at3jc5e', 'uploads/5365099dsc_7263_jpg', 'oapaynigeria', 'Aynigeria', 'oapaynigeria', '', '+2348104307517', '2021-10-08', NULL, 'a:2:{s:36:\"T3dvbGFiaSBCZW5pdGEgQXlvZGVqaS9hbGw=\";a:5:{s:2:\"id\";s:36:\"T3dvbGFiaSBCZW5pdGEgQXlvZGVqaS9hbGw=\";s:6:\"couple\";s:22:\"Owolabi Benita Ayodeji\";s:11:\"designation\";s:5:\"Bride\";s:8:\"guestdes\";s:579:\"<p>The Queen\'s name is Owolabi Benita Ayodeji,born on the 23rd of May in the early 1990\'s.</p><p>She moved from place to place as a child, attended different schools and finally graduated from Federal Government Girls\' College Efon Alaaye. She moved on to Osun State University where she studied Linguistics and Communication.</p><p>During her service year, she learnt Fashion designing all in a bid to be productive with her time without knowing it would become a career path. &nbsp;Today she is a proud CEO of a fashion house: CRYSTAL CLOTHING\'S and it\'s a fashion Academy.</p>\";s:5:\"image\";s:37:\"uploads/163310552579966base_image.jpg\";}s:32:\"QXlvZGVsZSBCcm93biBBa2FuZGUvYWxs\";a:5:{s:2:\"id\";s:32:\"QXlvZGVsZSBCcm93biBBa2FuZGUvYWxs\";s:6:\"couple\";s:20:\"Ayodele Brown Akande\";s:11:\"designation\";s:5:\"Groom\";s:8:\"guestdes\";s:3816:\"<p>A star dropped on the 10th of October, in the 90â€™s, into the family of Mr. &amp; Mrs. AKANDE.</p><p>Grew up in Oba-Ile Estate, Akure, Ondo State with both Primary and Secondary Schools in and around the estate.</p><p>Graduated at the age of 14 from Akure Academy and immediately defined his love for literary and creative arts by publishing his first book at age 15 titled WISDOM FROM ABOVE, published via his fatherâ€™s support.</p><p>He grew in his love for reading and writing and his vehement pursuit of an admission at the Obafemi Awolowo University OAU, kept him home for 4 years, giving him enough time to digest volumes of diverse literary works; unfortunately destiny had other plans.</p><p>Offered admission in 2010 into the then University of Ado-Ekiti, to study Agricultural Economics and Extension Services, even science couldnâ€™t stop his love for vast research, media and public speaking as he was instrumental to the launch of the first Debate Club at the Faculty of Agriculture after a glorious feat at an inter-varsity debate at FUTA.</p><p>His public speaking prowess subsequently earned him victories at inter-varsity debates at FUNAAB, and OAU, where he was denied admission severally.</p><p>As growth would have it, he already started anchoring Radio shows in 2013 on Progress 102.5FM, tagged Rainbow Revolution, while he also experimented with a few TV sequels at EKTV while juggling events at higher institutions within and outside Ekiti State.</p><p>Upon graduation from the University where he had developed his volunteering skills having served at SIFE, now Enactus EKSU in 2012, he was ready to give his skills and abilities to creating a better world.</p><p>The year 2016 was a defining year at Kolokuma/Opokuma LGA of Bayelsa where he had his NYSC Orientation camp as his iconic brand tag â€œAY Nigeriaâ€ was forged by many of his admirers on camp as he bore the unique state code 2020 (Vision 2020 was a popular theme at the time). He later went on to serve and work at the DAAR Communications RayPower Bayelsa, where he was nominated for the Rising Star award at the 2016 Bayelsa Media Award.</p><p>He would later grow into a Multi-award winning On Air Personality, Critical Thinking and Sutuation Analysis Expert with focus on Politics and Religion, Certified Counsellor, Human Resource Management Associate, Gender Advocate, Social Media Influencer, with over 27K followers in Twitter, Fashionista and a Prolific Speakingprenuer, having served as an on air personality at Vioice 89.9FM and head OAP at NewCruse FM Ikere. And Currently serving as the Marketing Manager Ayoba 95.1FM, Ado-Ekiti and the Chief Errand Officer of AY Nigeria Media Company.</p><p>He was also recently recognised by the government of Ekiti State as an He 4 She Ambassador, SDG Advicate for Goal 5(Cohort 1.0); Gender Equality and he his the project initiator of Project AY Nigeria Goes to School, where he uses his ordeal with sexual abuse to teach, mentor and advocate against all forms of &nbsp;sexual and gender based violence amongst secondary school students. He and his team have visited close to 40 secondary schools in Ekiti State and still continues to advocate against Rape and Gender Based violence as a renowned Feminist.</p><p>In November 2020, he was appointed to be a Board Member of the Stateâ€™s Action Committee Against AIDS, by the Dr. John Kayode Fayemi led administration of Ekiti State as one of youngest political appointees with Irepodun/Ifelodun LGA; Igede in mind.</p><p>On the international scene, he currently serves as the Vice President for the International Youth Diplomacy Conference IYDC, regularly hosted in Accra Ghana.</p><p>He is above all, a passionate Nigerian youth who uses his influence both online and on air to constantly advocate for a better Nigeria.</p>\";s:5:\"image\";s:37:\"uploads/163310745684649base_image.jpg\";}}', '#000000', '1', NULL, 'NGN', 'thumb/7729329thumb1633189688.jpg'),
