(10, 'Ayobami', 'Ayodele', 'ayo', '2022-08-26', 'WED_166153532190m143odwba2ie6a8y11', '05:35:21', 'hide', 'a:2:{s:40:\"T2xhbml5aSBPbHV3YXNlc2FuIFJvdGltaS9hbGw=\";a:6:{s:2:\"id\";s:40:\"T2xhbml5aSBPbHV3YXNlc2FuIFJvdGltaS9hbGw=\";s:12:\"bridal_train\";s:25:\"Olaniyi Oluwasesan Rotimi\";s:11:\"designation\";s:8:\"Best man\";s:4:\"crew\";s:5:\"Groom\";s:8:\"guestdes\";s:622:\"<p>Olaniyi Oluwasesan Rotimi aka Avatar Nisoj is a Sub Lieutenant in the Nigerian Navy and my very good friend and brother. One among the few colleagues, I can call any day anytime for anything and it will be done provided it is within his capacity.</p><p>Met him during my first weeks in NDA as a cadet, we became roommates and enjoyed a lot of holidays together. Nisoj is a free spirited man who loves God and enjoys adventures.&nbsp;</p><p>A very knowledgeable and versatile he wonâ€™t stop correcting my â€œEngineering-englishâ€. I am proud of him and I hope he finds a beautiful soulmate like his Korean crushes.</p>\";s:5:\"image\";s:37:\"uploads/166155551621348base_image.jpg\";}s:36:\"IFBldGVyIE9nb2NodWt3dSBOYW5jeSAvYWxs\";a:6:{s:2:\"id\";s:36:\"IFBldGVyIE9nb2NodWt3dSBOYW5jeSAvYWxs\";s:12:\"bridal_train\";s:23:\" Peter Ogochukwu Nancy \";s:11:\"designation\";s:13:\"Maid of Honor\";s:4:\"crew\";s:5:\"Bride\";s:8:\"guestdes\";s:697:\"<p>I met Peter Ogochukwu Nancy during my time at the university. I have always admired her spirit and candor.</p><p>She is a brilliant and focused young woman. I remember we both went into school politics because we wanted to bring positive change in our little community. Through thick and thin, she has stood by me, supporting and encouraging me.</p><p>A lot of times I worry about every little detail, she always tells me to be â€˜calming downâ€™ because everything will go well so far we have an outline planned out.</p><p><br>In her I found a sister, a friend and a political ally. Sheâ€™s indeed an intellectual woman, and I canâ€™t wait for the world to meet and appreciate her as I do.</p>\";s:5:\"image\";s:37:\"uploads/166155563656433base_image.jpg\";}}', 'a:5:{s:20:\"QmFzaCBFdmUgL2FsbA==\";a:5:{s:2:\"id\";s:20:\"QmFzaCBFdmUgL2FsbA==\";s:8:\"schedule\";s:9:\"Bash Eve \";s:11:\"designation\";s:10:\"31/09/2022\";s:5:\"venue\";s:11:\"Dave Hotel \";s:8:\"guestdes\";N;}s:32:\"U2luZ2xlIHdpdGggbGFkaWVzIC9hbGw=\";a:5:{s:2:\"id\";s:32:\"U2luZ2xlIHdpdGggbGFkaWVzIC9hbGw=\";s:8:\"schedule\";s:19:\"Single with ladies \";s:11:\"designation\";s:10:\"30/09/2022\";s:5:\"venue\";s:11:\"Dave Hotel \";s:8:\"guestdes\";N;}s:20:\"RW5nYWdtZW50IC9hbGw=\";a:5:{s:2:\"id\";s:20:\"RW5nYWdtZW50IC9hbGw=\";s:8:\"schedule\";s:10:\"Engagment \";s:11:\"designation\";s:10:\"31/09/2022\";s:5:\"venue\";s:11:\"Dave Hotel \";s:8:\"guestdes\";N;}s:40:\"VGltZSBvdXQgd2l0aCB0aGUgZmFtaWx5L2FsbA==\";a:5:{s:2:\"id\";s:40:\"VGltZSBvdXQgd2l0aCB0aGUgZmFtaWx5L2FsbA==\";s:8:\"schedule\";s:24:\"Time out with the family\";s:11:\"designation\";s:10:\"29/09/2022\";s:5:\"venue\";s:11:\"Mont Hotel \";s:8:\"guestdes\";N;}s:16:\"V2VkZGluZyAvYWxs\";a:5:{s:2:\"id\";s:16:\"V2VkZGluZyAvYWxs\";s:8:\"schedule\";s:8:\"Wedding \";s:11:\"designation\";s:10:\"01/10/2022\";s:5:\"venue\";s:31:\"Embassy Hall, Ado-Ekiti, Ekiti \";s:8:\"guestdes\";N;}}', NULL, '<p>Amazing 2 Â½ years of relationship and courtship with beautiful memories as well as challenging times but yes! we developed ourselves into this phase where we exchange marital vows under God\'s anointing and blessing on 13th August.</p>', 'a:6:{i:51791661536889;a:2:{s:5:\"image\";s:40:\"uploads/166155655649910wedding_image.jpg\";s:5:\"thumb\";s:32:\"thumb/5118390thumb1661556556.jpg\";}i:52761661536904;a:2:{s:5:\"image\";s:40:\"uploads/166155658273556wedding_image.jpg\";s:5:\"thumb\";s:32:\"thumb/7691330thumb1661556582.jpg\";}i:43281661536922;a:2:{s:5:\"image\";s:40:\"uploads/166155661127818wedding_image.jpg\";s:5:\"thumb\";s:32:\"thumb/3720401thumb1661556611.jpg\";}i:21011661556626;a:2:{s:5:\"image\";s:40:\"uploads/166155662678735wedding_image.jpg\";s:5:\"thumb\";s:32:\"thumb/9074678thumb1661556626.jpg\";}i:23291661556661;a:2:{s:5:\"image\";s:40:\"uploads/166155666195883wedding_image.jpg\";s:5:\"thumb\";s:32:\"thumb/4005880thumb1661556661.jpg\";}i:73741661556679;a:2:{s:5:\"image\";s:40:\"uploads/166155667945150wedding_image.jpg\";s:5:\"thumb\";s:32:\"thumb/2300665thumb1661556679.jpg\";}}', '1537374982obusn6a8u39t94101n5ol', 'uploads/1116610pexels_misha_earle_1777843_jpg', '', 'Bolajiolatubosun ', 'thisisboj', 'Mobolaji Olatunbosun', '+2348105315397', '2022-10-01', NULL, 'a:2:{s:16:\"QXlvZGVsZS9hbGw=\";a:5:{s:2:\"id\";s:16:\"QXlvZGVsZS9hbGw=\";s:6:\"couple\";s:7:\"Ayodele\";s:11:\"designation\";s:5:\"Groom\";s:8:\"guestdes\";s:663:\"<p>I met this beautiful damsel at Badagry, Lagos State in February 2019. I accompanied a senior colleague and friend (Standard) visit his then crush. Little did I know I was being led to meet my better half. We met his crush and her friend (Linda), when I saw her that day I was astonished and overwhelmed by such a gentle, kind, pretty and humble creature. I shot my shot (she dodged it) but she was too focused on her academics and wasn\'t ready for a relationship. She said we should pray about it and wait for God\'s revelation. I waited and waited for months (and got tired sef) until September 2019, when she gave me her green light and we started dating.</p>\";s:5:\"image\";s:37:\"uploads/166153649556248base_image.jpg\";}s:16:\"QXlvYmFtaS9hbGw=\";a:5:{s:2:\"id\";s:16:\"QXlvYmFtaS9hbGw=\";s:6:\"couple\";s:7:\"Ayobami\";s:11:\"designation\";s:5:\"Bride\";s:8:\"guestdes\";s:933:\"<p>I met this amazing man in NFLV Badagry 2019. At first, I thought he looked cute. I was instantly attracted to him. With hands in his pockets almost all the time, he always appeared smart in his senator outfits or T-shirt and pants whenever he came to visit. But then he was a bit too uptight. I for sure didnâ€™t want an uptight person, a person that wasnâ€™t going to reveal his true self to me. He did his best to prove to me that he was genuine. My roommates and friends encouraged me to go out with him. They kept calling his name when I get a call. They teased me a lot. But I wasnâ€™t having that at all. I remember in some of our conversations, he called me stubborn and he said, â€˜who is your father, I have to know him!â€™ I remember laughing so much because I felt he was unserious. Months passed and I forgot all about him for a while. But somehow we resumed communication again and in September we started dating.</p>\";s:5:\"image\";s:37:\"uploads/166153665379021base_image.jpg\";}}', '#2e87dc', '1', NULL, 'NGN', 'thumb/3547590thumb1661554794.jpg'),
